window.bookSummaryJSON = "<p><b>It started the moment I woke up in hospital; I naively believed I would find myself alone.</b></p> <p>I was wrong, because the HellBeast King wasn’t done with me.</p> <p>Far from it, in fact, as he told me he had made a vow...a vow to keep me safe.</p> <p>But as my fate started to unravel, revealing more and more pieces of him at the core, I couldn’t help but question: was his vow to keep me safe, or was it simply a HellBeast’s fight to keep me?</p>"; 
